B.Ni=new A.be("I was driving back home around 5pm the other day, and as I was trying to enter my apartment parking lot, I was struggling as per usual. at the entrance, there's this residents-only parking pass (magnet-ish thingie) that I have to wave at a machine in order for it to successfully recognize my parking pass, sort of like a sensor. For some reason, the sensor never functions successfully on the first try most of the time, which I've gotten used to.",null,null,B.q,null)
B.Nm=new A.be("Out of very little frustration, and perhaps more so out of acceptance of the reality that each time I enter my apartment I will always have to try waving my parking pass several times for the gate to open, I have always jokingly told my girlfriend that the sensor is a very poor sensor with a very low p, that is, probability of success.",null,null,B.q,null)
B.NI=new A.be("Like, if p were to be 0.10, that would mean that on average, I would have to try waving my parking pass 10 times to get one success (assuming a typical binomial distribution, as np = 10 * 0.1 = 1), meaning it takes me about 30 seconds to sometimes even a minute and a half to stay still in my car, waving my parking pass sort of looking like a fool, but I'm, at this point, unbothered because it's always been like that and friends living in my apartment complex have told me it is the same for them as well.",null,null,B.q,null)
B.NT=new A.be("This time, it was different - it took almost two minutes and the gate was still not open. It is not unexpected, as there is always tail-risk to a binomial distribution, and if I\u2019m living in this apartment complex for the third year, it is about time I get an instance of me waving my parking pass way more than ten times.",null,null,B.q,null)
B.NV=new A.be("I was starting to get a little annoyed and thought about pulling back my car and trying out the entrance that is at the other side of the parking lot, which is a course of action almost all of my friends living in the apartment complex had to do at some point in the past.",null,null,B.q,null)
B.Nu=new A.be("As I was pulling back my car, the maintenance staff member pulled up with his car exiting the parking lot (there is one barricade for going in and another for going out of the parking lot). He was probably going home after his work day. He pulled down his window and said, \u201chey man is it not working again?\u201d",null,null,B.q,null)
B.NA=new A.be("So I pulled down my window and said, \u201chey yeah it\u2019s not this bad usually but man it\u2019s just dead today\u201d",null,null,B.q,null)
B.NR=new A.be("He responded, \u201cyeah man that\u2019s why when I\u2019m at work I just pull the barricade up and turn it off because it is so bad, keep practicing though, you\u2019ll get better at it you have a good night\u201d",null,null,B.q,null)
B.ND=new A.be("His response gave me what is perhaps one of the most obvious, boring realizations, nonetheless a big one for me.",null,null,B.q,null)
B.NL=new A.be("I\u2019ve always thought that it is the sensor, the object, that has a perpetually fixed, low p parameter value (\u201csuccess rate\u201d), but his notion that if you practice you\u2019ll somehow \u201cget better at it\u201d prompted me to re-define the framework \u2014 the sensor does not necessarily have to have a perpetually fixed, low p parameter value, but really, each individual has their own p (success rate)!",null,null,B.q,null)
B.NF=new A.be("What if it\u2019s the other way? What if it truly is each individual having their distinct success rates due to difference in \u201cwaving skill\u201d, strength of magnet in parking pass, or for whatever reason?",null,null,B.q,null)
B.No=new A.be("I truly had not thought of it that way. I was very comfortable in my head to think and conclude from the very beginning that the sensor was just a very bad one with a low success rate, but it very much could be that every individual has their unique p (\u201csuccess rate\u201d), which completely overthrows my previous belief of \u201cthe sensor is bad, it is what it is\u201d and imbues this new belief of \u201cI do not know if the sensor is good or bad, but whether it takes 30 seconds or 90 seconds is up to me\u201d",null,null,B.q,null)
B.Nj=new A.be("Sure, in reality, it is probably a combination of both how good the sensor is and how good an individual\u2019s \u201cwaving skill/angle\u201d is, but his short response made me think about how many things in daily life I had previously assigned an external p (\u201csuccess rate\u201d) that I do not have control over. ",null,null,B.q,null)
B.Nl=new A.be("Assigning external p\u2019s on many things in daily life (parking barricade, Amazon Alexa hearing me when I say \u201cAlexa\u201d, trivial things like that) is sure comforting for me, but assigning an internal p, which I have the power to increase over time with, say, practice, was oddly an obvious, yet empowering notion he gave me in that very brief moment.",null,null,B.q,null)
B.NX=new A.be("In that preconceived notion of geometric distribution where X = k+1 such that k is the number of failures until my first success, I can employ a mental model where I can start believing that \u201cp\u201d is up to me, and not up to \u201cworld\u201d. That clearly means that, in that case, I have the power to skew the underlying distribution!",null,null,B.q,null)
B.NW=new A.be("It is a massively trivial situation and a massively trivial, non-riveting-to-some realization I had that day, but it made me think about how many more distributions in daily life (and perhaps in broader \u201clife\u201d) I can start owning and claim (whether it is true or not) that the parameters rather than letting \u201cworld\u201d decide the parameter values.",null,null,B.q,null)
B.Nw=new A.be("It was very cool of him to give me that moment of \u201cit is up to you if you believe it\u201d that day at the parking lot entrance. I ended up getting frustrated and still drove to the other gate and got back home that way, but still, it made me want to stop understanding and accepting certain distributions in life and mentally \u201cclaim/own\u201d it.",null,null,B.q,null)
B.Np=new A.be("I\u2019ll probably remember that moment for a very long time, but I had to write it down here because I did not want to forget.",null,null,B.q,null)
